interface IFairLaunch {
    function poolLength() external view returns (uint256);

    function addPool(
        uint256 _allocPoint,
        address _stakeToken,
        bool _withUpdate
    ) external;

    function setPool(
        uint256 _pid,
        uint256 _allocPoint,
        bool _withUpdate
    ) external;

    function pendingSea(uint256 _pid, address _user)
        external
        view
        returns (uint256);

    function updatePool(uint256 _pid) external;

    function deposit(
        address _for,
        uint256 _pid,
        uint256 _amount
    ) external;

    function withdraw(
        address _for,
        uint256 _pid,
        uint256 _amount
    ) external;

    function withdrawAll(address _for, uint256 _pid) external;

    function harvest(uint256 _pid) external;
}

interface ISea {
    function mint(address recipient_, uint256 amount_) external returns (bool);
}

// FairLaunch is a smart contract for distributing Sea by asking user to stake the ERC20-based token.
contract FairLaunch is IFairLaunch, Ownable, ReentrancyGuard {
    using SafeMath for uint256;
    using SafeERC20 for IERC20;

    uint256 constant GLO_VAL = 1e12;

    // Info of each user.
    struct UserInfo {
        uint256 amount; // How many Staking tokens the user has provided.
        uint256 rewardDebt; // Reward debt. See explanation below.
        uint256 bonusDebt; // Last block that user exec something to the pool.
        address fundedBy; // Funded by who?
        //
        // We do some fancy math here. Basically, any point in time, the amount of Seas
        // entitled to a user but is pending to be distributed is:
        //
        //   pending reward = (user.amount * pool.accSeaPerShare) - user.rewardDebt
        //
        // Whenever a user deposits or withdraws Staking tokens to a pool. Here's what happens:
        //   1. The pool's `accSeaPerShare` (and `lastRewardBlock`) gets updated.
        //   2. User receives the pending reward sent to his/her address.
        //   3. User's `amount` gets updated.
        //   4. User's `rewardDebt` gets updated.
    }

    // Info of each pool.
    struct PoolInfo {
        address stakeToken; // Address of Staking token contract.
        uint256 allocPoint; // How many allocation points assigned to this pool. Seas to distribute per block.
        uint256 lastRewardBlock; // Last block number that Seas distribution occurs.
        uint256 accSeaPerShare; // Accumulated Seas per share, times 1e12. See below.
        uint256 accSeaPerShareTilBonusEnd; // Accumated Seas per share until Bonus End.
    }

    // The Sea TOKEN!
    address public sea;
    // Dev address.
    address public devaddr;
    // Sea tokens created per block.
    uint256 public seaPerBlock;
    // Bonus muliplier for early sea makers.
    uint256 public bonusMultiplier;
    // Block number when bonus sea period ends.
    uint256 public bonusEndBlock;

    // Info of each pool.
    PoolInfo[] public poolInfo;
    // Info of each user that stakes Staking tokens.
    mapping(uint256 => mapping(address => UserInfo)) public userInfo;
    // Total allocation poitns. Must be the sum of all allocation points in all pools.
    uint256 public totalAllocPoint;
    // The block number when sea mining starts.
    uint256 public startBlock;
    //Executor
    mapping(address => bool) public executor;

    event Deposit(address indexed user, uint256 indexed pid, uint256 amount);
    event Withdraw(address indexed user, uint256 indexed pid, uint256 amount);
    event EmergencyWithdraw(
        address indexed user,
        uint256 indexed pid,
        uint256 amount
    );
    event SetDevAddress(address indexed devAddr);
    event SetSeaPerBlock(uint256 indexed seaPerBlock);
    event ManualMint(address indexed to, uint256 indexed amount);

    constructor(
        address _sea,
        address _devaddr,
        uint256 _seaPerBlock,
        uint256 _startBlock,
        uint256 _bonusEndBlock
    ) {
        bonusMultiplier = 0;
        totalAllocPoint = 0;
        sea = _sea;
        devaddr = _devaddr;
        seaPerBlock = _seaPerBlock;
        bonusEndBlock = _bonusEndBlock;
        startBlock = _startBlock;
        executor[msg.sender] = true;
    }

    // function initialize(
    //     address _sea,
    //     address _devaddr,
    //     uint256 _seaPerBlock,
    //     uint256 _startBlock,
    //     uint256 _bonusEndBlock
    // ) external initializer {
    //     __Ownable_init();

    //     bonusMultiplier = 0;
    //     totalAllocPoint = 0;
    //     sea = _sea;
    //     devaddr = _devaddr;
    //     seaPerBlock = _seaPerBlock;
    //     bonusEndBlock = _bonusEndBlock;
    //     startBlock = _startBlock;
    //     executor[msg.sender] = true;
    // }

    function setExecutor(address _address, bool _type)
        external
        onlyOwner
        returns (bool)
    {
        executor[_address] = _type;
        return true;
    }

    modifier onlyExecutor() {
        require(executor[msg.sender], "executor: caller is not the executor");
        _;
    }

    // Update dev address by the previous dev.
    function setDev(address _devaddr) public onlyOwner {
        require(_devaddr != address(0));
        devaddr = _devaddr;
        emit SetDevAddress(_devaddr);
    }

    function setSeaPerBlock(uint256 _seaPerBlock) public onlyOwner {
        seaPerBlock = _seaPerBlock;
        emit SetSeaPerBlock(_seaPerBlock);
    }

    // Set Bonus params. bonus will start to accu on the next block that this function executed
    // See the calculation and counting in test file.
    function setBonus(uint256 _bonusMultiplier, uint256 _bonusEndBlock)
        public
        onlyOwner
    {
        require(_bonusEndBlock > block.number, "setBonus: bad bonusEndBlock");
        require(_bonusMultiplier > 1, "setBonus: bad bonusMultiplier");
        bonusMultiplier = _bonusMultiplier;
        bonusEndBlock = _bonusEndBlock;
    }

    // Add a new lp to the pool. Can only be called by the owner.
    function addPool(
        uint256 _allocPoint,
        address _stakeToken,
        bool _withUpdate
    ) public override onlyOwner {
        if (_withUpdate) {
            massUpdatePools();
        }
        require(_stakeToken != address(0), "add: not stakeToken addr");
        require(!isDuplicatedPool(_stakeToken), "add: stakeToken dup");
        uint256 lastRewardBlock = block.number > startBlock
            ? block.number
            : startBlock;
        totalAllocPoint = totalAllocPoint.add(_allocPoint);
        poolInfo.push(
            PoolInfo({
                stakeToken: _stakeToken,
                allocPoint: _allocPoint,
                lastRewardBlock: lastRewardBlock,
                accSeaPerShare: 0,
                accSeaPerShareTilBonusEnd: 0
            })
        );
    }

    // Update the given pool's sea allocation point. Can only be called by the owner.
    function setPool(
        uint256 _pid,
        uint256 _allocPoint,
        bool _withUpdate
    ) public override onlyExecutor {
        if (_withUpdate) {
            massUpdatePools();
        }
        totalAllocPoint = totalAllocPoint.sub(poolInfo[_pid].allocPoint).add(
            _allocPoint
        );
        poolInfo[_pid].allocPoint = _allocPoint;
    }

    function isDuplicatedPool(address _stakeToken) public view returns (bool) {
        uint256 length = poolInfo.length;
        for (uint256 _pid = 0; _pid < length; _pid++) {
            if (poolInfo[_pid].stakeToken == _stakeToken) return true;
        }
        return false;
    }

    function poolLength() external view override returns (uint256) {
        return poolInfo.length;
    }

    function manualMint(address _to, uint256 _amount) public onlyOwner {
        ISea(address(sea)).mint(_to, _amount);
        emit ManualMint(_to, _amount);
    }

    // Return reward multiplier over the given _from to _to block.
    function getMultiplier(uint256 _lastRewardBlock, uint256 _currentBlock)
        public
        view
        returns (uint256)
    {
        require(_lastRewardBlock <= _currentBlock, "Block range exceeded");
        if (_currentBlock <= bonusEndBlock) {
            return _currentBlock.sub(_lastRewardBlock).mul(bonusMultiplier);
        }
        if (_lastRewardBlock >= bonusEndBlock) {
            return _currentBlock.sub(_lastRewardBlock);
        }
        // This is the case where bonusEndBlock is in the middle of _lastRewardBlock and _currentBlock block.
        return
            bonusEndBlock.sub(_lastRewardBlock).mul(bonusMultiplier).add(
                _currentBlock.sub(bonusEndBlock)
            );
    }

    // View function to see pending SEAs on frontend.
    function pendingSea(uint256 _pid, address _user)
        external
        view
        override
        returns (uint256)
    {
        PoolInfo storage pool = poolInfo[_pid];
        UserInfo storage user = userInfo[_pid][_user];
        uint256 accSeaPerShare = pool.accSeaPerShare;
        uint256 lpSupply = IERC20(pool.stakeToken).balanceOf(address(this));
        if (block.number > pool.lastRewardBlock && lpSupply != 0) {
            uint256 multiplier = getMultiplier(
                pool.lastRewardBlock,
                block.number
            );
            uint256 seaReward = multiplier
                .mul(seaPerBlock)
                .mul(pool.allocPoint)
                .div(totalAllocPoint);
            accSeaPerShare = accSeaPerShare.add(
                seaReward.mul(GLO_VAL).div(lpSupply)
            );
        }
        return
            user.amount.mul(accSeaPerShare).div(GLO_VAL).sub(user.rewardDebt);
    }

    // Update reward vairables for all pools. Be careful of gas spending!
    function massUpdatePools() public {
        uint256 length = poolInfo.length;
        for (uint256 pid = 0; pid < length; ++pid) {
            updatePool(pid);
        }
    }

    // Update reward variables of the given pool to be up-to-date.
    function updatePool(uint256 _pid) public override {
        PoolInfo storage pool = poolInfo[_pid];
        if (block.number <= pool.lastRewardBlock) {
            return;
        }
        uint256 lpSupply = IERC20(pool.stakeToken).balanceOf(address(this));
        if (lpSupply == 0) {
            pool.lastRewardBlock = block.number;
            return;
        }
        uint256 multiplier = getMultiplier(pool.lastRewardBlock, block.number);
        uint256 seaReward = multiplier
            .mul(seaPerBlock)
            .mul(pool.allocPoint)
            .div(totalAllocPoint);
        ISea(sea).mint(devaddr, seaReward.mul(20).div(100));
        ISea(sea).mint(address(this), seaReward);
        pool.accSeaPerShare = pool.accSeaPerShare.add(
            seaReward.mul(GLO_VAL).div(lpSupply)
        );
        // update accSeaPerShareTilBonusEnd
        if (block.number <= bonusEndBlock) {
            pool.accSeaPerShareTilBonusEnd = pool.accSeaPerShare;
        }
        if (
            block.number > bonusEndBlock && pool.lastRewardBlock < bonusEndBlock
        ) {
            uint256 SeaBonusPortion = bonusEndBlock
                .sub(pool.lastRewardBlock)
                .mul(bonusMultiplier)
                .mul(seaPerBlock)
                .mul(pool.allocPoint)
                .div(totalAllocPoint);
            pool.accSeaPerShareTilBonusEnd = pool.accSeaPerShareTilBonusEnd.add(
                SeaBonusPortion.mul(GLO_VAL).div(lpSupply)
            );
        }
        pool.lastRewardBlock = block.number;
    }

    // Deposit Staking tokens to FairLaunchToken for Sea allocation.
    function deposit(
        address _for,
        uint256 _pid,
        uint256 _amount
    ) public override nonReentrant {
        PoolInfo storage pool = poolInfo[_pid];
        UserInfo storage user = userInfo[_pid][_for];
        if (user.fundedBy != address(0))
            require(user.fundedBy == msg.sender, "bad sof");
        require(pool.stakeToken != address(0), "deposit: not accept deposit");
        updatePool(_pid);
        if (user.amount > 0) _harvest(_for, _pid);
        if (user.fundedBy == address(0)) user.fundedBy = msg.sender;
        IERC20(pool.stakeToken).safeTransferFrom(
            address(msg.sender),
            address(this),
            _amount
        );
        user.amount = user.amount.add(_amount);
        user.rewardDebt = user.amount.mul(pool.accSeaPerShare).div(GLO_VAL);
        user.bonusDebt = user.amount.mul(pool.accSeaPerShareTilBonusEnd).div(
            GLO_VAL
        );
        emit Deposit(msg.sender, _pid, _amount);
    }

    // Withdraw Staking tokens from FairLaunchToken.
    function withdraw(
        address _for,
        uint256 _pid,
        uint256 _amount
    ) public override nonReentrant {
        _withdraw(_for, _pid, _amount);
    }

    function withdrawAll(address _for, uint256 _pid)
        public
        override
        nonReentrant
    {
        _withdraw(_for, _pid, userInfo[_pid][_for].amount);
    }

    function _withdraw(
        address _for,
        uint256 _pid,
        uint256 _amount
    ) internal {
        PoolInfo storage pool = poolInfo[_pid];
        UserInfo storage user = userInfo[_pid][_for];
        require(user.fundedBy == msg.sender, "only funder");
        require(user.amount >= _amount, "withdraw: not good");
        updatePool(_pid);
        _harvest(_for, _pid);
        user.amount = user.amount.sub(_amount);
        user.rewardDebt = user.amount.mul(pool.accSeaPerShare).div(GLO_VAL);
        user.bonusDebt = user.amount.mul(pool.accSeaPerShareTilBonusEnd).div(
            GLO_VAL
        );
        if (pool.stakeToken != address(0)) {
            IERC20(pool.stakeToken).safeTransfer(address(msg.sender), _amount);
        }
        emit Withdraw(msg.sender, _pid, user.amount);
    }

    // Harvest Seas earn from the pool.
    function harvest(uint256 _pid) public override {
        PoolInfo storage pool = poolInfo[_pid];
        UserInfo storage user = userInfo[_pid][msg.sender];
        updatePool(_pid);
        _harvest(msg.sender, _pid);
        user.rewardDebt = user.amount.mul(pool.accSeaPerShare).div(GLO_VAL);
        user.bonusDebt = user.amount.mul(pool.accSeaPerShareTilBonusEnd).div(
            GLO_VAL
        );
    }

    function _harvest(address _to, uint256 _pid) internal {
        PoolInfo storage pool = poolInfo[_pid];
        UserInfo storage user = userInfo[_pid][_to];
        require(user.amount > 0, "nothing to harvest");
        uint256 pending = user.amount.mul(pool.accSeaPerShare).div(GLO_VAL).sub(
            user.rewardDebt
        );
        require(
            pending <= IERC20(sea).balanceOf(address(this)),
            "wtf not enough Sea"
        );
        safeSeaTransfer(_to, pending);
    }

    // Withdraw without caring about rewards. EMERGENCY ONLY.
    function emergencyWithdraw(uint256 _pid) public {
        PoolInfo storage pool = poolInfo[_pid];
        UserInfo storage user = userInfo[_pid][msg.sender];
        uint256 amount = user.amount;
        user.amount = 0;
        user.rewardDebt = 0;
        IERC20(pool.stakeToken).safeTransfer(address(msg.sender), amount);
        emit EmergencyWithdraw(msg.sender, _pid, user.amount);
    }

    // Safe Sea transfer function, just in case if rounding error causes pool to not have enough Seas.
    function safeSeaTransfer(address _to, uint256 _amount) internal {
        uint256 SeaBal = IERC20(sea).balanceOf(address(this));
        if (_amount > SeaBal) {
            IERC20(sea).transfer(_to, SeaBal);
        } else {
            IERC20(sea).transfer(_to, _amount);
        }
    }

    function getBlock() external view returns (uint256) {
        return block.number;
    }

    function withdrawalERC20(address _address, uint256 _amt)
        external
        onlyOwner
        returns (bool)
    {
        IERC20(_address).safeTransfer(msg.sender, _amt);
        return true;
    }
}
